export function loadScriptAsync(src) {
  return new Promise(function (resolve, reject) {
    let script = document.createElement('script')
    let head = document.getElementsByTagName('head')[0]
    script.type = 'text/javascript'
    script.charset = 'UTF-8'
    script.src = src
    if (script.addEventListener) {
      script.addEventListener('load', function () {
        resolve()
        head.removeChild(script)
      }, false)
    } else if (script.attachEvent) {
      script.attachEvent('onreadystatechange', function () {
        let target = window.event.srcElement
        if (target.readyState === 'loaded') {
          resolve()
          head.removeChild(script)
        }
      })
    }
    head.appendChild(script)
  })
}
// 处理红包转账
function handlePayment(content) {
  if (content.startsWith('<?xml') || content.startsWith('<msg')) {
    return {
      money: getTagContent(content, 'des').replace(/\<\!\[CDATA\[/g, '').replace(/]]/g, '').replace(/\>/g, ''),
      moneys: getTagContent(content, 'feedesc').replace(/\<\!\[CDATA\[/g, '').replace(/]]/g, '').replace(/\>/g, ''),
      moneyType: getTagContent(content, 'paysubtype')
    }
  } else if (content.includes('{')) {
    // 判断json
    try {
      return {
        money: JSON.parse(content).des
      }
    } catch (e) {
      return {
        money: content
      }
    }
  } else {
    return {
      money: content
    }
  }
}
String.prototype.processLabel = function () {
  let _this = this.toString()
  if (handlePayment(_this).moneyType == '1') {
    return '向您转账' + handlePayment(_this).money
  } else if (handlePayment(_this).moneyType == '3') {
    return '已收款' + handlePayment(_this).money
  } else if (handlePayment(_this).moneyType == '7') {
    return handlePayment(_this).money + handlePayment(_this).moneys
  } else {
    return handlePayment(_this).money
  }
}
export function formatDate(value = Date.now(), format = 'Y-M-D h:m:s') {
  const formatNumber = n => `0${n}`.slice(-2)
  const date = new Date(value)
  const formatList = ['Y', 'M', 'D', 'h', 'm', 's']
  const resultList = []
  resultList.push(date.getFullYear().toString())
  resultList.push(formatNumber(date.getMonth() + 1))
  resultList.push(formatNumber(date.getDate()))
  resultList.push(formatNumber(date.getHours()))
  resultList.push(formatNumber(date.getMinutes()))
  resultList.push(formatNumber(date.getSeconds()))
  for (let i = 0; i < resultList.length; i++) {
    format = format.replace(formatList[i], resultList[i])
  }
  return format
}

export function formatFileSize(fileSize = 0) {
  if (fileSize) {
    let size = fileSize.toString()
    if (size === '0') {
      return '0 KB'
    } if (size.length <= 4) {
      return `${(size / 1024).toFixed(2)} KB`
    } else if (size.length <= 8) {
      return `${(size / 1024 / 1024).toFixed(2)} MB`
    } else if (size.length <= 12) {
      return `${(size / 1024 / 1024 / 1024).toFixed(2)} GB`
    } else {
      return `${(size / 1024 / 1024 / 1024 / 1024).toFixed(2)} TB`
    }
  }
}

export function getTagContent(xml, tag) {
  let start = xml.indexOf(`<${tag}>`)
  let end = xml.indexOf(`</${tag}>`)
  if (start != -1 && end != -1) {
    return xml.substring(start + tag.length + 2, end)
  } else {
    return ''
  }
}
